NOT IN filter in a query with a join of two collections using MongDB C# driver<p>I have two collections that can be modelled with these classes (simplified version):</p>

<pre><code>public class Profile
{
    [BsonId]
    [BsonRepresentation(BsonType.String)]
    public Guid? Id { get; set; }
    public string Name { get; set; }        
    [BsonRepresentation(BsonType.String)]
    public Guid UserId { get; set; }
}

public class User
{
    [BsonId]
    [BsonRepresentation(BsonType.String)]
    public Guid? Id { get; set; }
    public string UserName { get; set; }        
    public bool IsConfirmed { get; set; }        
}
</code></pre>

<p>I need a query to get all the <code>UserProfiles</code> whose <code>User</code> has the <code>IsConfirmed</code> flag equals true, and then I need to filter out the ones whose Id is included in a list of excluded Ids:</p>

<pre><code>IList&lt;Guid&gt; profileIdsToExclude
</code></pre>

<p>This is the query I've built so far:</p>

<pre><code>var professionalProfilesQuery = 
    (from profileCollection in _mongoContext.Database.GetCollection&lt;Profile&gt;("profiles").AsQueryable()
     join userCollection in _mongoContext.Database.GetCollection&lt;User&gt;("users").AsQueryable()
     on profileCollection.UserId equals userCollection.Id.Value
     into users
     orderby profileCollection.Name
     select new ProfessionalProfile
     {
         Id = profileCollection.Id,
         Name = profileCollection.Name,                                                 
         UserId = profileCollection.UserId,
         IsConfirmed = users.First().IsConfirmed,                                                 
     })
     .Where(p =&gt; p.IsConfirmed &amp;&amp; !profileIdsToExclude.Contains(p.Id.Value));
</code></pre>

<p>Where <code>ProfessionalProfile</code> is a class to return the query result:</p>

<pre><code>public class ProfessionalProfile
{
    public Guid? Id { get; set; }
    public string Name { get; set; }        
    public Guid UserId { get; set; }
    public bool IsConfirmed { get; set; }        
}
</code></pre>

<p>I get UserProfiles, only the ones with <code>IsConfirmed</code> equals true. But the ones whose Id is in the list of excluded Ids are not filtered out and are returned by the query.</p>

<p>Any idea if what I want to do is possible and how? </p>

<p>Thanks in advance.</p>

