Implementing singleton mongDB DB object in NodeJS application<p>Currently working on a backend in nodeJS which uses <code>express</code>,<code>socket.io</code>, and has MongoDB as its database. I read that it is a good practice to implement a singleton DB connection which is to be reused in the entire application. I tried to implement this didn't find a solution yet. I tried to use <a href="https://stackoverflow.com/questions/24621940/how-to-properly-reuse-connection-to-mongodb-across-nodejs-application-and-module">this SO answer of go-oleg</a>.</p>

<p>I replicated the first part, the external mongoUtil.js file like this:</p>

<pre><code>var MongoClient = require( 'mongodb' ).MongoClient;

var _db;

module.exports = {

  connectToServer: function( callback ) {
    MongoClient.connect( "mongodb://localhost:27017/marankings", function( err, db ) {
      _db = db;
      return callback( err );
    } );
  },

  getDb: function() {
    return _db;
  }
};
</code></pre>

<p>Then in my server.js I call this function once like this (I don't do anything with the callback is this required?).</p>

<pre><code>var mongoUtil = require( 'mongoUtil' );

mongoUtil.connectToServer( function( err ) {
  // start the rest of your app here
} );
</code></pre>

<p>then when I tried the following in another module of the application:</p>

<pre><code>const db = mongoDB.getDb();

router.post('/', (req, res, next) =&gt; {
    console.log(db);
    next();
})
</code></pre>

<blockquote>
  <p>Logs undefined</p>
</blockquote>

<p>The log says <code>undefined</code> and thus I dont have a DB instance.</p>

<h2>Question:</h2>

<p>Why isn't this working and how can I solve this issue?</p>

