embedfield:
Using DBCollection.mapReduce to change MongoDB schema: spurious nested "value" attribute<p>I need to create a database patch that updates all elements of a MongoDB collection to a new format.
For example, grossly simplified, the old format has documents like this:</p>

<pre><code>{
  "_id" : ObjectId("572a7f30200cd11355083cd9"),
  "_class" : "Domain",
  "oldAttribute": 123
}
</code></pre>

<p>And the new format requires documents like that:</p>

<pre><code>{
  "_id" : ObjectId("572a7f30200cd11355083cd9"),
  "_class" : "Domain",
  "newAttribute": 123
}
</code></pre>

<p>I'm using MongoDB's Java API, and the database patches have to be written in Java as well, but rather than writing a bunch of Java code that modifies documents by first reading them and then writing them back, I figured that I could leverage <code>DBCollection.mapReduce()</code> with <code>MapReduceCommand.OutputType.REPLACE</code> to do the same thing with a small piece of JavaScript directly inside MongoDB, like so:</p>

<pre><code>myCollection.mapReduce(map, reduce, "myCollection", MapReduceCommand.OutputType.REPLACE, null);
</code></pre>

<p>For the <code>map</code> function, I pass something like:</p>

<pre><code>function () {
  var copy = {'_id': this._id, '_class': this._class, newAttribute: this.oldAttribute};
  emit(this._id, copy);
}
</code></pre>

<p>The <code>reduce</code> function should technically never be called as the keys are unique, so I just pass a dummy function there.</p>

<p>This seems to work, but there is one problem: after the map-reduce was applied, all documents in the collection now have a nested <code>value</code> attribute:</p>

<pre><code>{
  "_id": { "$oid" : "56c2371a200cd11088252111"},
  "value":
  {
    "_id": { "$oid" : "56c2371a200cd11088252111"},
    "_class": "Domain",
    "newAttribute": 123.0
  }
}
</code></pre>

<p>(this output is pasted from the Java console, so formatting is a little different)</p>

<p>My question, in short, is: how can I get rid of the nested <code>value</code> attribute and have all attributes (including <code>_id</code>) at the top level?</p>

