Error with JS roles TypeError: Cannot read property 'push' of undefined<p>I am having a little bit of an issue with setting roles within the admin panel of my site. the roles i have set are mmUser, mmMerchant, mmAdmin </p>

<p>when a user signs up they are auto set to mmUser, within the admin panel i am trying to set them to mmMerchant, right now i can do it manually throiugh the MongoDB set up. the weird thing is that i can downgrade them from merchant to mmUser through the panel but not put them as merchant. </p>

<p>any ideas?</p>

<pre><code>Controller.get('/make-merchant/:id/', function(req, res, next){
    let id = req.params.id;

    Collections
    .Schemas
    .Users
    .find()
    .then(results =&gt; {
        results.roles.push('mmMerchant');
        results.save()
        .then(user=&gt;{
            res.redirect('/management/users/');
        })
        .catch(next)
    })
    .catch(next)
});
</code></pre>

<p>The Error log states this</p>

<pre><code>TypeError: Cannot read property 'push' of undefined
Cannot read property 'push' of undefined
TypeError: Cannot read property 'push' of undefined
    at Collections.Schemas.Users.find.then.results (D:\pre200\pre\routes\management\users.js:69:22)
    at process._tickCallback (internal/process/next_tick.js:103:7)
</code></pre>

<p>UP TO DATE CODE</p>

<pre><code>Controller.get('/make-merchant/:id/', function(req, res, next){
    let id = req.params.id;

    Collections
    .Schemas
    .Users
    .find({_id: id })
    .then(results =&gt; {
       results[0].roles.push('mmMerchant');
        results.save()
        .then(user=&gt;{
            res.redirect('/management/users/');
        })
        .catch(next)
    })
    .catch(next)
});
</code></pre>

